query:
query socketPortMetrics ( $accountID:ID! $timeFrame:TimeFrame! $socketPortMetricsMeasure:[SocketPortMetricsMeasure] $socketPortMetricsDimension:[SocketPortMetricsDimension] $socketPortMetricsFilter:[SocketPortMetricsFilter!] $socketPortMetricsPostAggFilter:[SocketPortMetricsPostAggFilter!] $socketPortMetricsSort:[SocketPortMetricsSort!] $limit:Int $from:Int) {
	socketPortMetrics ( accountID:$accountID timeFrame:$timeFrame measures:$socketPortMetricsMeasure dimensions:$socketPortMetricsDimension filters:$socketPortMetricsFilter postAggFilters:$socketPortMetricsPostAggFilter sort:$socketPortMetricsSort ) {
		id
		from
		to
		total
		totals
		records ( limit:$limit  from:$from  )  {
			fieldsUnitTypes
			fieldsMap
			trends
			prevTimeFrame
		}
	}	
}
